import { useState } from "react";
import "./List.css";

function List() {
    const [isHover, setHover] = useState(false);

    return(
        <div className={"list__frame border rounded  " + (isHover && " shadow ")} 
            onMouseEnter={() => setHover(true)}
            onMouseLeave={() => setHover(false)}>
            <div className="list__content">
                <div className="list__img ">
                    <img className="img" src="https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fwww.motorcycle.com%2Fblog%2Fwp-content%2Fuploads%2F2020%2F12%2F12072020-2021-Honda-Trail-125-Review-11.jpg&f=1&nofb=1"/>
                </div>
                <div className="list__features">
                    <div>
                        <h5 className="list__text">Mine funn</h5>
                        <p className="list__text">15 annonser</p>                    
                    </div>
                    <div className="dropdown">
                        <span className="" type="button" aria-expanded="false" data-bs-toggle="dropdown" id="dropdown"><i class="fas fa-ellipsis-v fa-lg"></i></span>
                        <ul className="dropdown-menu" aria-labelledby="dropdown">
                            <li>Fjern</li>
                            <li>Regider</li>
                            <li></li>
                            <li>Fjern</li>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default List;
